import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to get to product listing page
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for sort controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_loaded.png'));

    // Apply price sort filter (low to high)
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for products to re-sort
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract product prices to verify sorting
    const prices = await page.$$eval('.product-price', elements => {
      return elements.map(el => {
        const text = el.textContent;
        const priceMatch = text.match(/\$\d+\.\d+/);
        return priceMatch ? parseFloat(priceMatch[0].replace('$', '')) : 0;
      });
    });

    // Verify prices are sorted in ascending order
    const isSorted = prices.every((price, i, arr) => i === 0 || price >= arr[i - 1]);

    return {
      success: true,
      action: "Applied price sort filter (low to high) on Electronics category",
      extractedData: {
        sortMethod: "Price: Low to High",
        productCount: prices.length,
        prices: prices.slice(0, 5), // First 5 prices
        isCorrectlySorted: isSorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
